$(document).ready(function(){$(".form-group .form-control").focusout(function(){if($(this).val()!=""){var a=$(this).parent().children(".float-label");$(a).addClass("active")}else{var a=$(this).parent().children(".float-label");$(a).removeClass("active")}});$(".form-group .form-control").each(function(){if($(this).val()!=""){var a=$(this).parent().children(".float-label");$(a).addClass("active")}else{var a=$(this).parent().children(".float-label");$(a).removeClass("active")}});$("[data-toggle='collapse']").on("click",function(){var a=$(this).attr("data-target");if($("#"+a).hasClass("in")){$("#"+a).removeClass("in")}else{$("#"+a).addClass("in")}})});